import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 45.2-846  Air quality.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/45.2-846.md","filePath":"vacode/45.2-846.md"}'),i={name:"vacode/45.2-846.md"},o=t('<h1 id="§-45-2-846-air-quality" tabindex="-1">§ 45.2-846 Air quality. <a class="header-anchor" href="#§-45-2-846-air-quality" aria-label="Permalink to &quot;§ 45.2-846  Air quality.&quot;">​</a></h1><p>A. All active workings shall be ventilated by a current of air containing at least 19.5 percent by volume of oxygen and no harmful amount of any noxious or poisonous gas.</p><p>B. The volume and velocity of the current of air in all active workings shall be sufficient to dilute, render harmless, and carry away flammable, explosive, noxious, and harmful gases, dust, smoke, and explosive fumes.</p><p>Code 1950, § 45-60.3; 1954, c. 191; 1966, c. 594, § 45.1-63; 1968, c. 310; 1993, c. 442; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0028" target="_blank" rel="noreferrer">28</a>, § 45.1-161.229; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0774" target="_blank" rel="noreferrer">774</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0003" target="_blank" rel="noreferrer">3</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0387" target="_blank" rel="noreferrer">387</a>.</p>',4),n=[o];function l(s,c,_,f,p,u){return a(),r("div",null,n)}const h=e(i,[["render",l]]);export{g as __pageData,h as default};
